import axios from "axios";
import React, { useState, useEffect } from "react";

const StudentProfile = (props) => {
  const [isLoading, SetisLoading] = useState(false);
    let url = 'http://localhost:8080/Student';
    let obj = {};
    let headers = {
        headers: {
            'Authorization':`Bearer eyJhbGciOiJIUzI1NiJ9.eyJzdWIiOiJtb2UiLCJpYXQiOjE2MjEwNjY0NDMsImV4cCI6MTYyMTA3MzY0M30.TsFBY0Rzxmt5_UlEmxBO0z73X7lxcUBfQh2H95kiUfo`
        }
    }
  useEffect(() => {
    SetisLoading(true);
    axios.get(url,obj,headers)
      .then((res) => {
        SetisLoading(false);
        console.log(res);
      })
      .catch((error) => {
        SetisLoading(false);
        console.log(error.response);
      });
  }, []);

  return (
    <div>
      Student profile
      {isLoading && <p>Obtaining data...</p>}
    </div>
  );
};

export default StudentProfile;
